import { Grid, makeStyles } from "@material-ui/core";
import React from "react";
import LocationListItem from "../molecules/LocationListItem/LocationListItem";
import { PrimaryProfileDisplay } from "../molecules/ProfileItem/ProfileItem.stories";
import SideNavBar from "../organisms/SideNavbar";
import TopNavBar from "./TopNavBar/TopNavBar";
import { TopNavBarPrimary } from "./TopNavBar/TopNavBar.stories";

const useStyles = makeStyles((theme) => ({
    leftGrid:{
        width: "270px",
        height: "900px"
    },
    rightGrid: {
        width: "1169px",
        height: "900px",
        //margin: 0 0 30px;

    }
}))


export function Page2(props){
    const classes = useStyles();
    return(
        <div>
            <Grid direction="column">
                <Grid className = {classes.leftGrid}>
                    <SideNavBar/>
                </Grid>
                <Grid className= { classes.rightGrid }>
                    <TopNavBar locationItem= { <LocationListItem children="East Marredpally, Secunderabad"/> } profileItem = { <PrimaryProfileDisplay /> }/>
                </Grid>
            </Grid>
        </div>
    );
}
